import './contact.css';
import emailjs from 'emailjs-com';

const Mailer = () => {
     function sendEmail(e){
         e.preventDefault();

         emailjs.sendForm('service_5l7kh0n','template_gx7wc6r',e.target,"user_MwbDvlvwreTZP8lUuL6jE").then(res=>{
              console.log(res);
         }).catch(err=> console.log(err)); 
     }

// export default class Contacts extends Component{
