    return(
        <div className="Contacts">
           <section id="contact">

  <h1 class="section-header">Contact</h1>

  <div class="contact-wrapper">



    <form id="contact-form" class="form-horizontal" role="form" onSubmit={sendEmail}>

      <div class="form-group">
        <div class="col-sm-12">
          <input type="text" class="form-control" id="name" placeholder="NAME" name="name"  required/>
        </div>
      </div>

      <div class="form-group">
        <div class="col-sm-12">
          <input type="email" class="form-control" id="email" placeholder="EMAIL" name="user_email" required/>
        </div>
      </div>

      <textarea class="form-control" rows="15" placeholder="MESSAGE" name="message" required></textarea>

      <button class="btn btn-primary send-button" id="submit" type="submit" value="SEND">
        <div class="alt-send-button">
          <i class="fa fa-paper-plane"></i><span class="send-text">SEND</span>
        </div>

      </button>

    </form>



      <div class="direct-contact-container">

        <ul class="contact-list">
          <li class="list-item"><i class="fa fa-map-marker fa-2x"><span class="contact-text place">City, State</span></i></li>

          <li class="list-item"><i class="fa fa-phone fa-2x"><span class="contact-text phone"><a href="https://api.whatsapp.com/send/?phone=%2B96171563884&text&app_absent=0" title="Give me a call">+961 71 563 884</a></span></i></li>

          <li class="list-item"><i class="fa fa-envelope fa-2x"><span class="contact-text gmail"><a href="# " title="Send me an email">saeed.el.jurdi@gmail.com </a></span></i></li>

        </ul>


        <ul class="social-media-list">
         <a href="#" target="_blank" class="contact-icon">
            <i class="fa fa-github" aria-hidden="true"></i></a>

         <a href="https://instagram.com/jurdi.saeed?utm_medium=copy_link" target="_blank" class="contact-icon">
            <i class="fa fa-codepen" aria-hidden="true"></i></a>

         <a href="https://instagram.com/jurdi.saeed?utm_medium=copy_link" target="_blank" class="contact-icon">
            <i class="fa fa-twitter" aria-hidden="true"></i></a>

         <a href="https://instagram.com/jurdi.saeed?utm_medium=copy_link"  target="_blank" class="contact-icon">
            <i class="fa fa-instagram" aria-hidden="true"></i></a>

        </ul>


        <div class="copyright">&copy; ALL OF THE RIGHTS RESERVED</div>

      </div>

  </div>

</section>  


        </div>
    )}

export default Mailer;
